import logo from './logo.svg';
import './App.css';
import {BrowserRouter,Routes,Route}  from "react-router-dom"
import { Course } from './Layout/Course';
function App() {
  return (
      <div>
        <BrowserRouter>
          <Routes>
          <Route path="/" element={Course} />
            <Route path="course" element={Course} />
          </Routes>
        </BrowserRouter>
      </div>
  );
}

export default App;
